import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import hero2 from "../images/hero2.jpg"; // 使用已有的背景图

const Partnership = () => {
  const navigate = useNavigate();
  const [location, setLocation] = useState({ state: "", city: "" });
  const [orgType, setOrgType] = useState("");
  const [goal, setGoal] = useState("");
  const [activeTab, setActiveTab] = useState(null);

  return (
    <div className="min-h-screen relative">
      {/* 半透明背景图 */}
      <div
        className="absolute inset-0 bg-cover bg-center"
        style={{
          backgroundImage: `url(${hero2})`,
          opacity: "0.3",
        }}
      />

      {/* 返回按钮 */}
      <button
        onClick={() => navigate(-1)}
        className="absolute top-8 left-8 text-gray-600 hover:text-gray-800 z-10"
      >
        <svg
          className="w-8 h-8"
          fill="none"
          stroke="currentColor"
          viewBox="0 0 24 24"
        >
          <path
            strokeLinecap="round"
            strokeLinejoin="round"
            strokeWidth={2}
            d="M10 19l-7-7m0 0l7-7m-7 7h18"
          />
        </svg>
      </button>

      {/* 主要内容 */}
      <div className="relative z-10 pt-32 px-4 sm:px-6 lg:px-8">
        <div className="max-w-5xl mx-auto text-center">
          <h1 className="text-5xl font-bold text-gray-900 mb-8">
            Let's Find Your Perfect Partner
          </h1>

          {/* 搜索框容器 */}
          <div className="bg-white rounded-lg shadow-xl p-6 mt-8">
            {/* 标签栏 */}
            <div className="flex space-x-4 mb-6">
              <button
                onClick={() => setActiveTab("location")}
                className={`flex-1 py-3 px-4 rounded-lg text-left ${
                  activeTab === "location"
                    ? "bg-teal-50 border-2 border-teal-500"
                    : "bg-gray-50 hover:bg-gray-100"
                }`}
              >
                <div className="text-sm text-gray-500">Location</div>
                <div className="font-medium truncate">
                  {location.state && location.city
                    ? `${location.city}, ${location.state}`
                    : "Select location"}
                </div>
              </button>

              <button
                onClick={() => setActiveTab("type")}
                className={`flex-1 py-3 px-4 rounded-lg text-left ${
                  activeTab === "type"
                    ? "bg-teal-50 border-2 border-teal-500"
                    : "bg-gray-50 hover:bg-gray-100"
                }`}
              >
                <div className="text-sm text-gray-500">Organization Type</div>
                <div className="font-medium truncate">
                  {orgType || "Select type"}
                </div>
              </button>

              <button
                onClick={() => setActiveTab("goal")}
                className={`flex-1 py-3 px-4 rounded-lg text-left ${
                  activeTab === "goal"
                    ? "bg-teal-50 border-2 border-teal-500"
                    : "bg-gray-50 hover:bg-gray-100"
                }`}
              >
                <div className="text-sm text-gray-500">Partnership Goal</div>
                <div className="font-medium truncate">
                  {goal
                    ? goal.substring(0, 30) + "..."
                    : "What are you looking for?"}
                </div>
              </button>

              <button className="bg-teal-500 hover:bg-teal-600 text-white px-8 rounded-lg transition-colors">
                Search
              </button>
            </div>

            {/* 弹出的输入区域 */}
            {activeTab === "location" && (
              <div className="bg-white p-4 rounded-lg border border-gray-200">
                <div className="grid grid-cols-2 gap-4">
                  <div>
                    <label className="block text-sm font-medium text-gray-700 mb-1">
                      State
                    </label>
                    <input
                      type="text"
                      className="w-full p-2 border rounded-md"
                      value={location.state}
                      onChange={(e) =>
                        setLocation({ ...location, state: e.target.value })
                      }
                      placeholder="Enter state"
                    />
                  </div>
                  <div>
                    <label className="block text-sm font-medium text-gray-700 mb-1">
                      City
                    </label>
                    <input
                      type="text"
                      className="w-full p-2 border rounded-md"
                      value={location.city}
                      onChange={(e) =>
                        setLocation({ ...location, city: e.target.value })
                      }
                      placeholder="Enter city"
                    />
                  </div>
                </div>
              </div>
            )}

            {activeTab === "type" && (
              <div className="bg-white p-4 rounded-lg border border-gray-200">
                <div className="grid grid-cols-2 gap-4">
                  <button
                    onClick={() => setOrgType("Nonprofit")}
                    className={`p-4 rounded-lg text-left ${
                      orgType === "Nonprofit"
                        ? "bg-teal-50 border-2 border-teal-500"
                        : "border border-gray-200 hover:border-teal-500"
                    }`}
                  >
                    <h3 className="font-medium">Nonprofit</h3>
                    <p className="text-sm text-gray-500">
                      NGOs, charities, and social organizations
                    </p>
                  </button>
                  <button
                    onClick={() => setOrgType("For-profit")}
                    className={`p-4 rounded-lg text-left ${
                      orgType === "For-profit"
                        ? "bg-teal-50 border-2 border-teal-500"
                        : "border border-gray-200 hover:border-teal-500"
                    }`}
                  >
                    <h3 className="font-medium">For-profit</h3>
                    <p className="text-sm text-gray-500">
                      Companies and businesses looking to make an impact
                    </p>
                  </button>
                </div>
              </div>
            )}

            {activeTab === "goal" && (
              <div className="bg-white p-4 rounded-lg border border-gray-200">
                <label className="block text-sm font-medium text-gray-700 mb-2">
                  What Kind of Organization Are You Looking For?
                </label>
                <textarea
                  className="w-full p-3 border rounded-lg h-32 resize-none"
                  value={goal}
                  onChange={(e) => setGoal(e.target.value)}
                  placeholder="Describe your ideal partnership..."
                />
              </div>
            )}
          </div>
        </div>
      </div>
    </div>
  );
};

export default Partnership;
